import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import StudentRegister from './components/Student/StudentRegister';
import StudentLogin from './components/Student/StudentLogin';
import StudentList from './components/Student/StudentList';
import StudentUpdate from './components/Student/StudentUpdate';
import FacultyRegister from './components/Faculty/FacultyRegister';
import FacultyLogin from './components/Faculty/FacultyLogin';
import FacultyList from './components/Faculty/FacultyList';
import FacultyUpdate from './components/Faculty/FacultyUpdate';
import FeedbackForm from './components/Feedback/FeedbackForm';
import CourseRegistration from './components/Course/CourseRegistration';
import CourseList from './components/Course/CourseList';
import CourseUpdate from './components/Course/CourseUpdate';
import ProtectedRoute from './components/ProtectedRoute';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const handleLogin = () => {
    setIsLoggedIn(true);
  };

  const handleLogout = () => {
    setIsLoggedIn(false);
  };

  return (
    <Router>
      <div className="App" style={{ backgroundColor: '#f5f5dc', minHeight: '100vh' }}>
        <header className="App-header">
          <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
            <div className="container-fluid">
              <Link className="navbar-brand" to="/">Project Management</Link>
              <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
              </button>
              <div className="collapse navbar-collapse" id="navbarNav">
                <ul className="navbar-nav">
                  <li className="nav-item dropdown">
                    <Link className="nav-link dropdown-toggle" to="#" id="studentDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                      Student Service
                    </Link>
                    <ul className="dropdown-menu" aria-labelledby="studentDropdown">
                      <li><Link className="dropdown-item" to="/student/login">Login</Link></li>
                      <li><Link className="dropdown-item" to="/student/register">Register</Link></li>
                      {isLoggedIn && (
                        <>
                          <li><Link className="dropdown-item" to="/students">List</Link></li>
                          <li><Link className="dropdown-item" to="/student/update/1">Update</Link></li> {/* Example ID for update */}
                        </>
                      )}
                    </ul>
                  </li>
                  <li className="nav-item dropdown">
                    <Link className="nav-link dropdown-toggle" to="#" id="facultyDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                      Faculty Service
                    </Link>
                    <ul className="dropdown-menu" aria-labelledby="facultyDropdown">
                      <li><Link className="dropdown-item" to="/faculty/login">Login</Link></li>
                      <li><Link className="dropdown-item" to="/faculty/register">Register</Link></li>
                      {isLoggedIn && (
                        <>
                          <li><Link className="dropdown-item" to="/faculties">List</Link></li>
                          <li><Link className="dropdown-item" to="/faculty/update/1">Update</Link></li> {/* Example ID for update */}
                        </>
                      )}
                    </ul>
                  </li>
                  <li className="nav-item dropdown">
                    <Link className="nav-link dropdown-toggle" to="#" id="courseDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                      Course Service
                    </Link>
                    <ul className="dropdown-menu" aria-labelledby="courseDropdown">
                      <li><Link className="dropdown-item" to="/course/register">Register</Link></li>
                      {isLoggedIn && (
                        <>
                          <li><Link className="dropdown-item" to="/courses">List</Link></li>
                          <li><Link className="dropdown-item" to="/course/update/1">Update</Link></li> {/* Example ID for update */}
                        </>
                      )}
                    </ul>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link" to="/feedback">Feedback Form</Link>
                  </li>
                  {isLoggedIn && (
                    <li className="nav-item">
                      <button className="nav-link btn btn-link" onClick={handleLogout}>Logout</button>
                    </li>
                  )}
                </ul>
              </div>
            </div>
          </nav>
        </header>
        <main className="container mt-5">
          <div className="text-center mb-5">
            <h1>Welcome to College Management System</h1>
          </div>
          <Routes>
            <Route path="/student/register" element={<StudentRegister />} />
            <Route path="/student/login" element={<StudentLogin onLogin={handleLogin} />} />
            <Route path="/students" element={
              <ProtectedRoute isLoggedIn={isLoggedIn}>
                <StudentList />
              </ProtectedRoute>
            } />
            <Route path="/student/update/:id" element={
              <ProtectedRoute isLoggedIn={isLoggedIn}>
                <StudentUpdate />
              </ProtectedRoute>
            } />
            <Route path="/faculty/register" element={<FacultyRegister />} />
            <Route path="/faculty/login" element={<FacultyLogin onLogin={handleLogin} />} />
            <Route path="/faculties" element={
              <ProtectedRoute isLoggedIn={isLoggedIn}>
                <FacultyList />
              </ProtectedRoute>
            } />
            <Route path="/faculty/update/:id" element={
              <ProtectedRoute isLoggedIn={isLoggedIn}>
                <FacultyUpdate />
              </ProtectedRoute>
            } />
            <Route path="/feedback" element={<FeedbackForm />} />
            <Route path="/course/register" element={<CourseRegistration />} />
            <Route path="/courses" element={
              <ProtectedRoute isLoggedIn={isLoggedIn}>
                <CourseList />
              </ProtectedRoute>
            } />
            <Route path="/course/update/:id" element={
              <ProtectedRoute isLoggedIn={isLoggedIn}>
                <CourseUpdate />
              </ProtectedRoute>
            } />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
